    internal InnerInAppTemplateBodyConfigFactory BodyConfigFactory { get; set; }

    internal InnerInAppTemplateButtonConfigFactory SecondaryBtnFactory { get; set; }

    internal InnerInAppTemplateButtonConfigFactory PrimaryBtnFactory { get; set; }

    internal InnerInAppTemplateHeaderConfigFactory HeaderConfigFactory { get; set; }

    protected override Humidifier.Pinpoint.InAppTemplateTypes.InAppMessageContent Create()
    {
        var inAppMessageContentResult = CreateInAppMessageContent();
        factoryAction?.Invoke(inAppMessageContentResult);

        return inAppMessageContentResult;
    }

    private Humidifier.Pinpoint.InAppTemplateTypes.InAppMessageContent CreateInAppMessageContent()
    {
        var inAppMessageContentResult = new Humidifier.Pinpoint.InAppTemplateTypes.InAppMessageContent();

        return inAppMessageContentResult;
    }
    public override void CreateChildren(Humidifier.Pinpoint.InAppTemplateTypes.InAppMessageContent result)
    {
        base.CreateChildren(result);

        result.BodyConfig ??= BodyConfigFactory?.Build();
        result.SecondaryBtn ??= SecondaryBtnFactory?.Build();
        result.PrimaryBtn ??= PrimaryBtnFactory?.Build();
        result.HeaderConfig ??= HeaderConfigFactory?.Build();
    }

} // End Of Class

